import './App.css';
import React, { useEffect, useState } from 'react';
import { Button, Typography, Card, CardContent, Grid } from '@mui/material';
import { BrowserRouter, Routes, Route, Link, useParams } from 'react-router-dom';

function App() {
    return (
        <BrowserRouter>
            <div className="App">
                <header className="App-header">
                    <Typography variant="h4" className="App-title">
                        Weather App
                    </Typography>
                </header>
                <Routes>
                    <Route path="/" element={<Home />} />
                    <Route path="/:day" element={<DetailedForecast />} />
                </Routes>
                <footer className="App-footer">
                    <Typography variant="body2" className="App-footer-text">
                        Created by <b>Gabriel Źrebiec</b>
                    </Typography>
                </footer>
            </div>
        </BrowserRouter>
    );
}

function Home() {
    const [pogodaKrakow, setPogodaKrakow] = useState(null);

    useEffect(() => {
        fetchWeatherData('Krakow', setPogodaKrakow);
    }, []);

    const fetchWeatherData = async (location, setData) => {
        try {
            const response = await fetch(
                `https://api.open-meteo.com/v1/forecast?latitude=50.0614&longitude=19.9366&daily=temperature_2m_max,temperature_2m_min,sunrise,sunset,precipitation_probability_max&timezone=Europe%2FBerlin`
            );
            if (!response.ok) {
                throw new Error('Nie udało się pobrać danych pogodowych');
            }
            const data = await response.json();
            setData(data);
        } catch (error) {
            console.error(error);
        }
    };

    return (
        <div className="App-content">
            <Typography variant="h5" className="Home-title">
                Dzisiaj w Krakowie
            </Typography>
            {pogodaKrakow && (
                <Grid container spacing={3}>
                    <Grid item xs={12} sm={6} md={3}>
                        <Card>
                            <CardContent>
                                <Typography>
                                    Wschód słońca: <b>{pogodaKrakow.daily.sunrise[0].split('T')[1]}</b>
                                </Typography>
                            </CardContent>
                        </Card>
                    </Grid>
                    <Grid item xs={12} sm={6} md={3}>
                        <Card>
                            <CardContent>
                                <Typography>
                                    Zachód słońca: <b>{pogodaKrakow.daily.sunset[0].split('T')[1]}</b>
                                </Typography>
                            </CardContent>
                        </Card>
                    </Grid>
                    <Grid item xs={12} sm={6} md={3}>
                        <Card>
                            <CardContent>
                                <Typography>
                                    Temperatura maksymalna: <b>{pogodaKrakow.daily.temperature_2m_max[0]}°C</b>
                                </Typography>
                            </CardContent>
                        </Card>
                    </Grid>
                    <Grid item xs={12} sm={6} md={3}>
                        <Card>
                            <CardContent>
                                <Typography>
                                    Temperatura minimalna: <b>{pogodaKrakow.daily.temperature_2m_min[0]}°C</b>
                                </Typography>
                            </CardContent>
                        </Card>
                    </Grid>
                    <Grid item xs={12} sm={6} md={3}>
                        <Card>
                            <CardContent>
                                <Typography>
                                    Szansa opadów: <b>{pogodaKrakow.daily.precipitation_probability_max[0]}%</b>
                                </Typography>
                            </CardContent>
                        </Card>
                    </Grid>
                </Grid>
            )}
            <div>
                <Button variant="contained" component={Link} to="/dzis" className="Home-button">
                    Szczegółowa prognoza
                </Button>
            </div>
            <hr className="App-divider" />

            <Typography variant="h5" className="Home-title">
                Prognoza na kolejne dni
            </Typography>

            {pogodaKrakow && (
                <Grid container spacing={3}>
                    {/* ... Analogicznie do powyższego */}
                </Grid>
            )}
        </div>
    );
}

function DetailedForecast() {
    const { day } = useParams();
    const [pogodaKrakow, setPogodaKrakow] = useState(null);

    useEffect(() => {
        fetchWeatherData('Krakow', setPogodaKrakow);
    }, []);

    const fetchWeatherData = async (location, setData) => {
        try {
            const response = await fetch(
                `https://api.open-meteo.com/v1/forecast?latitude=50.060567&longitude=19.937694&hourly=temperature_2m,precipitation_probability,precipitation,surface_pressure,cloudcover`
            );
            if (!response.ok) {
                throw new Error('Nie udało się pobrać danych pogodowych');
            }
            const data = await response.json();
            setData(data);
        } catch (error) {
            console.error(error);
        }
    };

    return (
        <div className="App-content">
            <Typography variant="h5" className="Detail-title">
                Szczegółowa prognoza na {day}
            </Typography>
            {pogodaKrakow && (
                <table className="Detail-table">
                    <thead>
                        <tr>
                            <th>Godzina</th>
                            <th>Temperatura</th>
                            <th>Opady</th>
                            <th>Szansa opadów</th>
                            <th>Zachmurzenie</th>
                            <th>Ciśnienie</th>
                        </tr>
                    </thead>
                    <tbody>
                        {[...Array(24)].map((_, index) => (
                            <tr key={index}>
                                {/* ... Analogicznie do powyższego */}
                            </tr>
                        ))}
                    </tbody>
                </table>
            )}
            <Button variant="contained" component={Link} to="/" className="Detail-button">
                Powrót
            </Button>
        </div>
    );
}

export default App;
